import React, { useState } from 'react'
import styles from './ItensLista.module.css'

export default function ItensLista({onDelete, metodo, juros, ativo}) {
  const [estado, setEstado] = useState(false)

  const alteracao = () => {
    setEstado(!estado)
  }
  return (
    <div className={styles.container}>
        Metodo:
        <input className={styles.input} value={metodo} />
        Juros:
        <input className={styles.input} value={juros} />
        Ativo:
        <input value={estado} onClick={alteracao} onChange={ativo=estado} type='checkbox'/>
        <button onClick={onDelete}>Deletar</button>
    </div>
  )
}
